function Navbar() {
  return (
    <nav>
      <h1 className="text-xl m-2">Brand</h1>
      <ul className="text-xl m-2">
        <li>Priceing</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}

ReactDOM.render(<Navbar />, document.getElementById("root"));
